namespace RonSijm.FluidHumidifier.Factories.SES;

public class EmailIdentityFactory(string resourceName = null, Action<Humidifier.SES.EmailIdentity> factoryAction = null) : ResourceFactory<Humidifier.SES.EmailIdentity>(resourceName)
{

    internal InnerEmailIdentityConfigurationSetAttributesFactory ConfigurationSetAttributesFactory { get; set; }

    internal InnerEmailIdentityDkimSigningAttributesFactory DkimSigningAttributesFactory { get; set; }

    internal InnerEmailIdentityDkimAttributesFactory DkimAttributesFactory { get; set; }

    internal InnerEmailIdentityFeedbackAttributesFactory FeedbackAttributesFactory { get; set; }

    internal InnerEmailIdentityMailFromAttributesFactory MailFromAttributesFactory { get; set; }

    protected override Humidifier.SES.EmailIdentity Create()
    {
        var emailIdentityResult = CreateEmailIdentity();
        factoryAction?.Invoke(emailIdentityResult);

        return emailIdentityResult;
    }

    private Humidifier.SES.EmailIdentity CreateEmailIdentity()
    {
        var emailIdentityResult = new Humidifier.SES.EmailIdentity
        {
            GivenName = InputResourceName,
        };

        return emailIdentityResult;
    }
    public override void CreateChildren(Humidifier.SES.EmailIdentity result)
    {
        base.CreateChildren(result);

        result.ConfigurationSetAttributes ??= ConfigurationSetAttributesFactory?.Build();
        result.DkimSigningAttributes ??= DkimSigningAttributesFactory?.Build();
        result.DkimAttributes ??= DkimAttributesFactory?.Build();
        result.FeedbackAttributes ??= FeedbackAttributesFactory?.Build();
        result.MailFromAttributes ??= MailFromAttributesFactory?.Build();
    }

} // End Of Class

